import React, { useEffect, useState } from 'react';

const Experiments = () => {
    const [experiments, setExperiments] = useState(null);
    const [error, setError] = useState(null);

    // Fetch the experiments data from the backend
    useEffect(() => {
        fetch('/api/experiments')
            .then((response) => {
                if (!response.ok) {
                    throw new Error('Network response was not ok');
                }
                return response.json();
            })
            .then((data) => setExperiments(data))
            .catch((error) => setError(error));
    }, []);

    if (error) {
        return <div>Error: {error.message}</div>;
    }

    if (!experiments) {
        return <div>Loading...</div>;
    }

    return (
        <div>
            <h1>Experiments Page</h1>
            <ul className="experiments-list">
                {Object.keys(experiments).map((chapter) => (
                    <li key={chapter}>
                        <h2>{chapter}</h2>
                        <ul>
                            {experiments[chapter].map((experiment, index) => (
                                <li key={index}>
                                    <a href={experiment.url}>{experiment.name}</a>
                                </li>
                            ))}
                        </ul>
                    </li>
                ))}
            </ul>
        </div>
    );
};

export default Experiments;
